import React, { Component } from 'react';
import {BootstrapTable, TableHeaderColumn} from 'react-bootstrap-table';

import 'react-bootstrap-table/css/react-bootstrap-table.css'


const Table1  = ({data}) => {
        return (
                <BootstrapTable data = {data} className="MainTable">
                    <TableHeaderColumn isKey dataField='id' hover>
                        ID
                    </TableHeaderColumn>
                    <TableHeaderColumn dataField='name' hover>
                        Name
                    </TableHeaderColumn>
                    <TableHeaderColumn dataField='value' hover>
                        Value
                    </TableHeaderColumn>
                </BootstrapTable>
        );
}
export default Table1;
